import React, { useState } from "react";
import axios from "axios";
import Container from 'react-bootstrap/Container';
import logo from '../images/fisiminho.png'

const Navbar = () => {
    return (
        <>
            <Nav>
                <NavLink to="/">
                    <img src={logo}/>
                </NavLink>
                <Bars />
            </Nav>
        </>
    );
};

export default Navbar;
